script: |
  super -f text -I q9590.spq | sort > q9590.out

inputs:
  - name: q9590.spq
    data: |
      SELECT DISTINCT 39 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab0 (FORMAT parquet) cor1, tab2 (FORMAT parquet) AS cor2, tab0 (FORMAT parquet) cor3;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9590.out
    data: |
      39
